import React from "react";
import { Link } from "react-router-dom";
import { useState } from "react";
import Product from "../components/product";
const Home = () => {

    const products = [
        {
            name: "Pizza",
            imageUrl: "https://t3.gstatic.com/licensed-image?q=tbn:ANd9GcQcHbxCjB7FY6Rttw1VZFdh0gIZmm4MLLjfmD0dhA11saxBKG_D49VVkmlvz3sE71-b",
            price:20.40,
            quantityInCart: 0,
        },
        {
            name: "Burger",
            imageUrl: "https://mir-s3-cdn-cf.behance.net/project_modules/fs/cf29c385555335.5d7fb3c164383.jpg",
            price: 35,
            quantityInCart: 0,
        },
        {
            name: "Fries",
            imageUrl: "https://images.immediate.co.uk/production/volatile/sites/30/2021/03/French-fries-b9e3e0c.jpg?resize=768,574",
            price: 8.50,
            quantityInCart: 0,
        },
        {
            name: "Espetinho de Carne",
            imageUrl: "data:image/jpeg;base64,",
            price: 15.50,
            quantityInCart: 0,
        },
        {
            name: "Espetinho de Frango",
            imageUrl: "https://anamariabraga.globo.com/wp-content/uploads/2020/08/kebab-frango-no-espeto-ana-maria.jpg",
            price: 12.50,
            quantityInCart: 0,
        },
        {
            name: "Parmegiana de Carne",
            imageUrl: "data:image/jpeg;base64,",
            price: 45,
            quantityInCart: 0,
        },
        {
            name: "Parmegiana de Frango",
            imageUrl: "data:image/jpeg;base64,  ",
            price: 40,
            quantityInCart: 0,
        },
        {
            name: "Nuggets",
            imageUrl: "data:image/jpeg;base64,",
            price: 20.50,
            quantityInCart: 0,
        },
        {
            name: "Petit Gateau",
            imageUrl: "data:image/jpeg;base64,",
            price: 25.50,
            quantityInCart: 0,
        },
        {
            name: "Brownie da Paolla",
            imageUrl: "data:image/jpeg;base64,",
            price: 8,
            quantityInCart: 0,
        },
    ]
    const [productsList, setProductsList] = useState(products);

    const handleAddToCartClick = (productName: string) => {
        setProductsList(prevProducts => 
            prevProducts.map(product => 
                product.name === productName
                    ? {
                        ...product,
                        quantityInCart: product.quantityInCart + 1
                      }
                    : product
            )
        );
    };
    
    const removeFromCart = (productName: string) => {
        setProductsList(prevProducts => 
            prevProducts.map(product => 
                product.name === productName
                    ? {
                        ...product,
                        quantityInCart: product.quantityInCart > 0 ? product.quantityInCart - 1 : 0
                      }
                    : product
            )
        );
    };

    return (
        <>
            <div className="w-full max-w-screen-lg h-screen pb-12 bg-center bg-zinc-950 bg-opacity-50 flex flex-col justify-start items-center gap-6 mx-auto">
                <div className="w-full h-12 px-12 bg-zinc-600 bg-opacity-70 shadow shadow-inner flex justify-between items-center ">
                    <div className=" text-zinc-200 text-sm font-normal"><h4><b>Mary's Restaurant</b></h4></div>
                    <Link to={"/cart"} state={{data: productsList.filter(product => product.quantityInCart >0 )}} className=" p-4"><div className="text-white font-normal underline text-sm">Ver sacola</div></Link>
                </div>

                <div className=" ms-16 flex justify-start w-full text-xs text-zinc-900 "> <b><h2>O que deseja pedir hoje?</h2></b></div>

                <div className=" grid grid-cols-5 gap-8">
                {productsList.map(product => (
                <Product
                    key={product.name}
                    name={product.name}
                    imageUrl={product.imageUrl}
                    price={product.price}
                    quantityInCart={product.quantityInCart || 0}
                    handleAddToCartClick={() => handleAddToCartClick(product.name)}
                    removeFromCart={() => removeFromCart(product.name)}
                />
            ))}</div>
                
            </div>

            


            
        </>
        
    );
}

export default Home;